        <script>
        document.addEventListener('DOMContentLoaded', function() {
            // Attendre que la carte soit initialisée
            setTimeout(function() {
                // Trouver l'objet carte Leaflet
                var mapElement = document.querySelector('.folium-map');
                if (mapElement && mapElement._leaflet_map) {
                    var map = mapElement._leaflet_map;
                    var labelsLayer = null;

                    // Trouver la couche des labels (nom: Étiquettes)
                    map.eachLayer(function(layer) {
                        if (layer.options && layer.options.name &&
                            layer.options.name.indexOf('tiquettes') !== -1) {
                            labelsLayer = layer;
                        }
                    });

                    // Fonction pour gérer la visibilité des labels
                    // Zoom >= 14 : labels visibles (vue détaillée)
                    // Zoom < 14 : labels masqués (vue d'ensemble lisible)
                    function updateLabelsVisibility() {
                        var zoom = map.getZoom();
                        if (labelsLayer) {
                            if (zoom >= 14) {
                                if (!map.hasLayer(labelsLayer)) {
                                    map.addLayer(labelsLayer);
                                }
                            } else {
                                if (map.hasLayer(labelsLayer)) {
                                    map.removeLayer(labelsLayer);
                                }
                            }
                        }
                    }

                    // Écouter les changements de zoom
                    map.on('zoomend', updateLabelsVisibility);

                    // Masquer au chargement initial (vue d'ensemble)
                    updateLabelsVisibility();
                }
            }, 500);
        });
        </script>
